import React, { Component } from 'react';
import logo from '../../logo.svg';
import '../css/App.css';

class App extends Component {

  constructor( props ){
   super( props );
 }

  handleOnClick = () => {
    this.props.playSong();
  }
  render() {
    return (
      <div className="App">
        <button type="button" onClick={this.handleOnClick}>Play</button>
      </div>
    );
  }
}

export default App;
